(2, 2, 'Fry', 'zu Leym', 'm', '1748-04-15', 1, 2, 0, 1, 0, 'Ritter Christophs Vater "Raimund zu Leym", der einst einer bürgerlichen Familie abstammte, wurde in Zeiten großer Not zu den Waffen gerufen \r\nund machte sich im Kampf um Ehre, Ruhm und Länderereien derart verdient, dass seine Familie geadelt wurde. \r\nSomit kam sein Erstgeborener zu der Ehre Knappe zu werden. \r\nNach dem Ritterschlag machte sich Ritter Christoph in Schlachten und Turnieren einen Namen als "Frey zu Leym".<br>\r\nSein Vater verschuldete sich auf Grund der Lebensweise als Adeliger immer mehr und gab Stück für Stück seine Ländereien ab um die Schulden zu bezahlen.\r\nWährend Christophs Abwesenheit schrumpfte der Familienbesitz zu einem kleinen Landstrich südöstlich von Augsburg. \r\nNach der Rückkehr von seinen Reisen und dem Tod seines Vaters fand Ritter Christoph, nun "Graf Christoph zu Leym", nur noch ein kleines Haus \r\nmit einem kleinen bisschen Land vor, dass er sein Eigen nennen durfte. <br>\r\nDie Familie des Bauern, der bereits seinem Vater treu ergeben war, hielt das wenige, übrige in Ordnung und Christoph zog wieder in die Ferne. \r\nNachdem er im Norden seine <a href="site.php?site=wappenrolle&f=Leym&m=nane&sh=1" class="tdlink">Gemahlin</a> traf, wurde sein Reisedrang ruhiger und er verbrachte mit \r\nseiner Frau und seiner Familie viel Zeit in seiner "alten Heimat".\r\nDort fand er Anschluss bei einer Gruppe von gleichgesinnten Rittern aus dem Umland von Augsburg, mit denen er fortan durch die Lande zog.', 1, 16),
(3, 2, 'Nane', 'zu Leym', 'f', '2017-04-09', 0, 2, 2, 0, 0, '', 1, 10),
(4, 2, 'Christoph II', 'zu Leym', 'm', '1715-07-29', 5, 2, 3, 0, 0, '', 1, 3),
(9, 2, 'Lara', 'zu Leym', 'f', '2017-04-23', 0, 2, 3, 0, 0, '', 1, 1),
(11, 2, 'Ben', 'zu Leym', 'm', '', 0, 2, 3, 0, 0, '', 1, 1),
(12, 23, 'der Basti', 'Bogis chutze', 'm', '2017-12-01', 2, 3, 0, 1, 0, '', 1, 1),
(13, 2, 'Wasser', 'Platsch', 'f', '2017-01-01', 4, 4, 0, 2, 2, '', 1, 1),
